class shipSquad extends App {
    functionTest = () => {
        console.log("Clicked")
    }
    render () {
        return (
            <div className="button-container">
                <AddShip click={this.functionTest}/>
                <AddSquadron/>
            </div>
        )
    }
}

export default shipSquad;
